INSERT INTO `episodes` VALUES (86,'1.01','Movin\' On Over','2005-03-03','Meghan\'s moving in! Jon\'s a piece of shit! Grady\'s off the wall! Dave may or may not have cured cancer!',2694771,'2013-04-27 15:31:41','2013-04-27 15:31:41','Uncle_Nagys_House_1x01_Movin_On_Over.avi'),(87,'1.02','Snowed In','2005-03-30','The roommates get snowed in with a very special guest, and Grady does not react well to the confinement.',3264766,'2013-04-27 15:31:41','2013-04-27 15:31:41','Uncle_Nagys_House_1x02_Snowed_In.avi'),(88,'1.03','PSA','2005-05-16','Jon gets into some trouble with the law and is sentenced to make a Public Service Announcement as punishment.',3272457,'2013-04-27 15:31:41','2013-04-27 15:31:41','Uncle_Nagys_House_1x03_PSA.avi'),(89,'xmas','Christmas Special','2005-12-25','Jon decides to teach that old Scrooge Wade Shaw the true meaning of Christmas.',22674508,'2013-04-27 15:31:41','2013-04-27 15:31:41','unh_christmas_special.xvid.avi'),(90,'1.04','Jailbreak','2005-10-11','Jon has just been released on parole, and he\'s ready to resume his life as a free man - but not if Detective Feeback Jones has anything to say about it.',22676860,'2013-04-27 15:31:41','2013-04-27 15:31:41','Uncle_Nagys_House_1x04_Jailbreak.avi'),(91,'1.05','Battle of the Bands','2006-01-11','To save Uncle Nagy\'s House - a legend is born.',22673530,'2013-04-27 15:31:41','2013-04-27 15:31:41','unh--1x05--battle_of_the_bands.xvid.avi'),(92,'1.06','Milk Challenge','2006-10-25','With the mayor in control of Uncle Nagy\'s House and Jon out on the street, the gang only has one chance left to save the day. That\'s right: they\'re having a milk challenge.',22670144,'2013-04-27 15:31:42','2013-04-27 15:31:42','unh--1x06--milk_challenge.xvid.avi'),(93,'2.01','The Littlest Cat','2009-01-07','You\'ve never seen a feline like this before! Ladies and gentleman, spoonfullofpoo.com presents the phantasmagorical first appearance of -- The Littlest Cat!',2957840,'2013-04-27 15:31:42','2013-10-12 21:10:45','unh201.mp4'),(94,'2.02','The Blind Date','2009-01-14','The return of Jon Tomlinson! A secret passion revealed! Grady the Mailman with a mustache! All this and more in today\'s action-packed installment of Uncle Nagy\'s House.',2951401,'2013-04-27 15:31:42','2013-10-12 21:10:45','unh202.mp4'),(95,'2.03','Uncle Nagy\'s Safe House','2009-01-21','In today\'s kaleidoscopic caper, our hero must brave the road less traveled. The road to -- Uncle Nagy\'s Safe House.',2930972,'2013-04-27 15:31:42','2013-10-12 21:10:45','unh203.mp4'),(96,'2.04','Buzz Aldrin & The Moon Man','2009-01-28','Uncle Nagy\'s Safe House is safe no more! Join Jon Tomlinson on his jeopardous journey to the farthest reaches of civilization and learn the terrible truth of Buzz Aldrin & The Moon Man.',3014465,'2013-04-27 15:31:42','2013-10-12 21:10:45','unh204.mp4'),(97,'2.05','John Lertch: Time Traveling Rapist','2009-02-04','Behold a world not bound by the laws of physics. The world of... John Lertch, time traveling rapist!',3197016,'2013-04-27 15:31:42','2013-10-12 21:10:45','unh205.mp4'),(98,'2.06','Prestidigitation','2009-02-13','The fantastic return of Detective Feeback Jones! And -- what nefarious fate lurks behind the safehouse door? Find out in today\'s electrifying episode of Uncle Nagy\'s House!',3196577,'2013-04-27 15:31:42','2013-10-12 21:10:45','unh206.mp4'),(99,'2.07','The Littlest Valentine','2009-02-20','An Uncle Nagy\'s House Valentine\'s Day vignette!',3295015,'2013-04-27 15:31:42','2013-10-12 21:10:45','unh207.mp4'),(100,'2.08','Best Friends Forever (Part I)','2009-02-27','Days of Ansbach Past!',3393544,'2013-04-27 15:31:42','2013-10-12 21:10:45','unh208.mp4'),(101,'2.09','The Mixed Up Tale of  Rob Lowe and Paul T. Papajack','2009-03-06','The secret origin of Grady the Mailman!',3500543,'2013-04-27 15:31:43','2013-10-12 21:10:45','unh209.mp4'),(102,'2.10','The Baltimore Bumper Jump','2009-03-13','Get ready for a hair-raising hobo adventure with those delightful derelicts Les and Dutch!',3617739,'2013-04-27 15:31:43','2013-10-12 21:10:45','unh210.mp4'),(103,'2.11','Raspberry Jello','2009-03-20','The strange tale of Eyepatch Jon and Victor Bell!',3774340,'2013-04-27 15:31:43','2013-10-12 21:10:45','unh211.mp4'),(104,'2.12','The Dark Maverick Saga','2009-03-29','The Dark Maverick has emerged! Join us for the conclusion of episode 6\'s cataclysmic cliff hanger and the culmination of the first arc of Uncle Nagy\'s House Season 2!',3944103,'2013-04-27 15:31:43','2013-10-12 21:10:45','unh212.mp4'),(105,'2.13','The Kangaroo Incident','2009-04-03','An epic tale of muttonchops and marsupials from New Plagmanton\'s past!',3984366,'2013-04-27 15:31:43','2013-10-12 21:10:45','unh213.mp4'),(106,'2.14','Back And To The Left','2009-04-16','Who will guard the guards themselves? None, but the Mizan!',4203453,'2013-04-27 15:31:43','2013-10-12 21:10:45','unh214.mp4'),(107,'2.15','Butterdog Falls','2009-04-16','Out of New Plagmanton and into Butterdog Falls! Part one of Jon and Norman\'s rampageous road trip adventure.',4192533,'2013-04-27 15:31:43','2013-10-12 21:10:45','unh215.mp4'),(108,'2.16','Free Comic Book Day','2009-05-01','May 2nd is Free Comic Book Day at Wayne\'s Comic Madness!',4425612,'2013-04-27 15:31:43','2013-10-12 21:10:45','unh216.mp4'),(109,'2.17','The Littlest Cancellation','2009-05-08','Jon and Norman\'s trip to Twin Springs is further diverted by the startling news that The Littlest Cat has been canceled by SFOP TV.',4561952,'2013-04-27 15:31:43','2013-10-12 21:10:45','unh217.mp4'),(110,'2.18','Meet the Mavericks','2009-05-15','In which The Maverick meditates on family, future, and all that shit.\r\n\r\n(This episode was created as part of the 2009 Philadelphia 48 Hour Film Project.)',4651049,'2013-04-27 15:31:43','2013-10-12 21:10:45','unh218.mp4'),(111,'2.19','Trinitiation','2009-08-04','\"Call it a crisis of leadership.\" - Proposition Joe',5943989,'2013-04-27 15:31:43','2013-10-12 21:10:45','unh219.mp4'),(112,'2.20','The Complete Works of Boatzart','2009-08-18','\"We ain\'t gotta dream no more, man.\" - Stringer Bell',6158449,'2013-04-27 15:31:43','2013-10-12 21:10:45','unh220.mp4'),(113,'2.21','The Good, the Bad and the Denim','2009-09-05','\"Come at the king, you best not miss.\" - Omar',6443810,'2013-04-27 15:31:43','2013-10-12 21:10:45','unh221.mp4'),(115,'hobos','Hungry, Hungry Hobos','2007-07-04','A lesser known adventure from Jon\'s days as mayor of Olde Plagmanton. We shot this in 2007 as a DVD extra for the ultra-rare Uncle Nagy\'s House Season 1 DVD.',23781128,'2013-05-04 22:12:13','2013-10-12 21:10:45','');
/*!40000 ALTER TABLE `episodes` ENABLE KEYS */;
